import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import {BrowserRouter as Router, Route, Redirect, Switch}from  'react-router-dom';
import Navbar from './components/template/navbar.component.js';
//import Home from './components/pages/home.component.js';
import Registration from './components/pages/registration.component';
import ClientRegistered from './components/pages/clientsRegistered.component';
import EditClients from './components/pages/edit.component';


const App=()=> {
  return (
    <Router>
      <div>
        <Navbar/>
      <Switch>   
              {/* <Route path="/" exact><Home/></Route>     */}       
              <Route path="/registration"><Registration/></Route>
              <Route path="/users"><ClientRegistered/></Route>
              <Route path="/edit/id"><EditClients/></Route>         
        <Redirect to="/"/>
      </Switch>
      </div>
    </Router>
  );
} 

export default App;
